import { Link } from "react-router-dom";

function Header() {
  return (
    <nav style={{ padding: "10px", background: "#eee" }}>
      <Link to="/" style={{ margin: "10px" }}>Home</Link>
      <Link to="/shop" style={{ margin: "10px" }}>Shop</Link>
    </nav>
  );
}

export default Header;
